import React from 'react';
import ReactDOM from 'react-dom';
import './card.css';
import 'bootstrap/dist/css/bootstrap.min.css'

const card=(props)=>{
    return(
        <div className="row">
            <div className="col">
                <div className="pics">
                    <img src={`https://robohash.org/${ props.username }?200*200`} alt="pro" />
                    <div>
                        <h1>
                            { props.name }
                        </h1>
                        <h1>
                            { props.email }
                        </h1>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default card;
